import React from 'react';
import { SingleTodo } from "./SingleTodo";

export const ViewList = ({ TodoData, DelTodo }) => {
  return(
    <div>
      <h4>Todoリスト</h4>
      <ul>
        {
          TodoData.length > 0 &&  
            TodoData.map((Todo, Index) => {
              return (
                // <li key={Index}>{Todo}</li>
                <SingleTodo key={Index} todo={Todo} DelTodo={DelTodo}/>
              )
            })
        }
      </ul>

    </div>
  )
}
